import React from 'react';
import SingleQuiz from './SingleQuiz';

function Quizzes({ quizzes }) {
    console.log({quizzes})
  return (
    <div>

    {quizzes.map (quiz => quiz.map(q => <SingleQuiz key = {q.id} {...q}/>))}
    </div>
  );
}

export default Quizzes;
